#!/usr/bin/env python

import re


rawwords = {
    "whitelist": "",
    "blacklist": "",
}

def trans(t):
    return "".join(chr((ord(c) + 2503 + 7) % 26 + 97) for c in t)

whitelist = set(re.findall(r".{1,5}", rawwords['whitelist']))
blacklist = set(re.findall(r".{1,5}", rawwords['blacklist']))

print(f'Whitelist ({len(whitelist)} words)')
for word in whitelist:
    print("  ", trans(word))

print(f'Blacklist ({len(blacklist)} words)')
for word in blacklist:
    print("  ", trans(word))
